test("create_pull_request should return a pull request object when the initial get is unsuccessful", async () => {

  server.use(
    rest.get(
      "https://api.github.com/repos/chrisreddington/rss-parser/pulls",
      (req, res, ctx) => res(ctx.status(404))
    )
  );

  // Act & Assert
  expect(
    await utils.create_pull_request(github.getOctokit(github_token), itemObject, input_config)).toStrictEqual(expectedPostOutputObject);
});

test("create_pull_request should return null when the initial get is unsuccessful, followed by an unsuccessful post", async () => {

  server.use(
    rest.get(
      "https://api.github.com/repos/chrisreddington/rss-parser/pulls",
      (req, res, ctx) => res(ctx.status(404))
    ),
    rest.post(
      "https://api.github.com/repos/chrisreddington/rss-parser/pulls",
      (req, res, ctx) => res(ctx.status(403))
    )
  );

  // Act & Assert
  expect(
    await utils.create_pull_request(github.getOctokit(github_token), itemObject, input_config)).toBe(null);
});